import React from 'react';
import PropTypes from 'prop-types';
import './AssetTypesInfo.scss';
import { isValidData } from '../../utils/common';

const AssetTypeInfo = props => {
  const { Data } = props;
  if(isValidData(Data)){
    const DaysToProcess =
    Data && Data.days_to_process ? Data.days_to_process : '';
    const Attributes =
      Data && Data.attributes
        ? Data.attributes.map(attribute => {
            return (
              <div key={attribute.get_attribute.id}>
                {attribute.get_attribute.name}
              </div>
            );
          })
        : [];
    return (
      <div className="card border">
        <div className="card-body">
          <p>
            {' '}
            <span className="header">Days to Process: </span> {DaysToProcess}{' '}
          </p>
          <p className="header">Attributes:</p>
          {Attributes}
        </div>
      </div>
    );
  }
  return null;
};

AssetTypeInfo.propTypes = {
  Data: PropTypes.object.isRequired
};

AssetTypeInfo.defaultProps = {
  Data: {}
};
export default AssetTypeInfo;
